import React from "react";

import './Fotos.css';


const fotos = props => {
    let fotoClasses= 'side-drawer';
    if(props.show) {
        fotoClasses= 'side-drawer open';
    }
    return(
        <nav className={fotoClasses}>
            <div className="grid">
                <img href={ props.img } alt="importImage" />
            </div>
        </ nav>
    );
};


export default fotos;
